// sidebar.service.ts

import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root',
})
export class SidebarService {
  menu: any[] = [
    {
      title: 'dashboard',
      icon: 'nav-icon fas fa-tachometer-alt',
      submenu: [
        { title: 'Usuarios', url: 'usuarios', icon: 'fas fa-user' },
        { title: 'Productos', url: 'productos', icon: 'fas fa-box' },
        { title: 'Stock', url: 'stock', icon: 'fas fa-cube' },
      ],
    },
  ];

  constructor() {}
}
